window.bookSummaryJSON = "<p><b>They were trying to get back to Hell...but Hell showed up at our door.</b></p> <p>None of us expected a visit from the devil himself, but after Lucifer comes a-knocking, we know things are about to heat up fast.</p> <p>According to the demons, the only way to protect me is to bind us all together. Forever. Something I’m not sure I’m even willing to do. But with Greed’s ring still on my finger and Lucifer’s sights set on making me his next plaything, what other choice do I have?</p> <p>When I’m dragged to Hell against my will, I’m determined to find a way topside again. But the darkness within me is enjoying this deadly vacation a little too much, and my powers only seem to grow the longer I stay.</p> <p>My demons will risk it all to save me from eternal damnation.</p> <p>But after going to Hell and back, will <i>I </i>still be the same in the end?</p> <p><b>The epic and alluring demon romance continues with </b><b><i>To Hell and Back</i></b><b>! Don't be left in the dark. One-click to get your copy today!</b></p> <p><b><i>To Hell and Back</i></b><b> is book four in the Sin Demons Series.</b></p>"; 
